//generate qrcode
async function generateQRCode(dataToEncode, size) {
  try {
    console.log('Data to encode:', dataToEncode); // Add this line
    const canvas = await QRCode.toCanvas(dataToEncode, { width: size }); // Generate the QR code and get the canvas element
    return canvas.toDataURL('image/png'); // Convert the canvas to a data URL (base64-encoded image)
  } catch (error) {
    console.error(error);
    return null;
  }
}

// generate barcode
async function generateBarcode(dataToEncode, width, height) {
  try {
    const canvas = document.createElement('canvas');
    await JsBarcode(canvas, dataToEncode, {
      format: 'CODE128', // You can choose the barcode format here (CODE128, EAN, etc.)
      displayValue: true, // Display the value of the barcode below it

    });
    return canvas.toDataURL('image/png');
  } catch (error) {
    console.error(error);
    return null;
  }
}


